import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      {/* Left: Fiverr Logo */}
      <div className="navbar-left">
        <h2 className="logo">
          fiverr<span className="dot">.</span>
        </h2>
      </div>

      {/* Center Navigation */}
      <ul className="navbar-center">
        <li><a href="#">Fiverr Pro ‚ñæ</a></li>
        <li><a href="#">Explore ‚ñæ</a></li>
        <li><a href="#">üåê EN</a></li>
      </ul>

      {/* Right Section */}
      <div className="navbar-right">
        <a href="#" className="login-btn">Sign in</a>
        <a href="#" className="join-btn">Join</a>
      </div>
    </nav>
  );
};

export default Navbar;
